import React from "react";
import styled from "styled-components";
import Search from "../common/Search";

const Wrapper = styled.main`
  width: 100%;
  height: 100%;
`;

function Ask() {
  return (
    <Wrapper>
      <Search />
    </Wrapper>
  );
}

export default Ask;
